"bigQuerySettings":{"projectId":"bigquery-public-data","datasetId":"github_repos","tableId":"sample_repos","lastRefreshed":null,"sourceLastModified":null,"customCredential":null},"bigQueryMirrorSettings":null,"storageSettings":null,"remoteUrlSettings":null,"remoteGithubSettings":null},"render":null,"children":[],"name":"sample_repos","description":"Top 400k GitHub repositories with more than 2 stars received during Jan-May 2016.\n\nThis set is used to select entries for sample_files and sample_contents.\n\nSELECT\n    repo_name,\n    COUNT(*) watch_count\nFROM\n  [githubarchive:month.201605],\n  [githubarchive:month.201604],\n  [githubarchive:month.201603],\n  [githubarchive:month.201602],\n  [githubarchive:month.201601]\nWHERE type=\u0022WatchEvent\u0022\nGROUP BY 1\nHAVING watch_count \u003e= 2\nORDER BY watch_count DESC\nLIMIT 400000"}],"name":"GitHub Repos","description":"GitHub is how people build software and is home to the largest community of open source developers in the world, with over 12 million people contributing to 31 million projects on GitHub since 2008.\n\nThis 3TB+ dataset comprises the largest released source of GitHub activity to date. It contains a full snapshot of the content of more than 2.8 million open source GitHub repositories including more than 145 million unique commits, over 2 billion different file paths, and the contents of the latest revision for 163 million files, all of which are searchable with regular expressions. \n\n### Querying BigQuery tables\n\nYou can use the BigQuery Python client library to query tables in this dataset in Kernels. Note that methods available in Kernels are limited to querying data. Tables are at `bigquery-public-data.github_repos.[TABLENAME]`. **[Fork this kernel to get started][1]** to learn how to safely manage analyzing large BigQuery datasets.\n\n### Acknowledgements\nThis dataset was made available per [GitHub\u0027s terms of service](https://help.github.com/articles/github-terms-of-service/). This dataset is available via Google Cloud Platform\u0027s Marketplace, [GitHub Activity Data][2], as part of [GCP Public Datasets][3].\n\n### Inspiration\n- This is the perfect dataset for fighting language wars.\n- Can you identify any signals that predict which packages or languages will become popular, in advance of their mass adoption?\n\n\n  [1]: https://www.kaggle.com/mrisdal/safely-analyzing-github-projects-popular-licenses\n  [2]: https://console.cloud.google.com/marketplace/details/github/github-repos\n  [3]: https://cloud.google.com/public-datasets/"},{"imageUrl":"https://storage.googleapis.com/kaggle-datasets-images/7150/10244/f1b99b9c5adb2b0c8c985294c9607d46/dataset-thumbnail.jpg?t=2017-12-15-20-05-05","sourceUrl":"/pytorch/vgg13bn","slug":"vgg13bn","lastUpdated":"2017-12-15T19:51:58.71Z","overview":"VGG-13 Pre-trained model with batch normalization for PyTorch","sourceType":"dataset","sourceVersionType":"fileset","sourceId":10244,"sourceVersionNumber":1,"maxVersionNumber":1,"descriptionMimeType":"text/x-markdown","deleted":false,"private":false,"privateButVisible":false,"ownerInfo":{"databundleVersionId":10244,"dataset":{"datasetId":7150,"datasetVersionId":10244,"dataviewToken":"eyJhbGciOiJkaXIiLCJlbmMiOiJBMTI4Q0JDLUhTMjU2In0..X48Gmx2ufcvwsBvp8l6QOA.ytIg2xk1IppCSdNXJch5a5wxP1goVFqabvFHg5R7PnqKi3zjYBY4MURO7gwpBMJKxcKWVBFYJmkViICAvrQB6a71MjswgX24cc3VVP9n9xdI8NrzP9n6KLsX4mNBoDyh-n3NJQGh_5g1WdI_KC7Ln9RqA9ALComTduyk6lg4d57Y5-8xLZjrb6cMDVQoMoQ7tbPxXoTXWRnmgKsia7U20njHkhCUT44L-3qnig1abL-gUxZJZCW-U4gz1_HmS-nRMtlWQ0wip3PEY2orYvwXX2yxAGwMcnX-LTNxhRfvUEmpQYe4YrNdUEIEh46INeczUdK59yEHRmOdg-3ZIQiOd2UrdYT4hVjJ43f1a4t49B0dg1PcWYB7oShWYPzxGOfu2aOGWw1TA6gBLYrb7lSGpw9lfD4U6EgDdFzqbPGTidv9dal81kClf3M33IxiNLgC.Sz9FTyoz-QDe-Z_Awkjw2g","scope":"pytorch/vgg13bn"},"competition":null,"kernel":null,"previewsDisabled":false},"type":"dataSource","collapsed":false,"info":{"metrics":null,"archiveInfo":null,"archiveInfoV2":null,"blobFileInfo":null,"convertCsvInfo":null,"kernelReference":null},"settings":{"csvSettings":null,"bigQuerySettings":null,"bigQueryMirrorSettings":null,"storageSettings":null,"remoteUrlSettings":null,"remoteGithubSettings":null},"render":null,"children":[{"id":27180,"blobFileId":362600,"databundleVersionId":10244,"databundleVersionObjectType":"file","url":null,"relativePath":"../input/vgg13_bn.pth","creationDate":"2017-12-15T19:51:28.136Z","isDummy":false,"size":532246301,"fullPath":"../input/vgg13bn/vgg13_bn.pth","previewUrl":null,"downloadUrl":"/pytorch/vgg13bn/downloads/vgg13_bn.pth/1","fileType":".pth","contentLength":532246301,"contentType":"application/octet-stream","contentMD5":"2ft4inQ3/j+l5AzOam1MPw==","validationErrors":null,"type":"databundleVersionObject","collapsed":false,"info":null,"settings":null,"render":null,"children":[],"name":"vgg13_bn.pth","description":"## VGG-13 with batch normalization for PyTorch"}],"name":"VGG-13 with batch normalization","description":"# VGG-13\n\n---\n\n## Very Deep Convolutional Networks for Large-Scale Image Recognition\u003cbr\u003e\nIn this work we investigate the effect of the convolutional network depth on its accuracy in the large-scale image recognition setting. Our main contribution is a thorough evaluation of networks of increasing depth using an architecture with very small (3x3) convolution filters, which shows that a significant improvement on the prior-art configurations can be achieved by pushing the depth to 16-19 weight layers. These findings were the basis of our ImageNet Challenge 2014 submission, where our team secured the first and the second places in the localisation and classification tracks respectively. We also show that our representations generalise well to other datasets, where they achieve state-of-the-art results. We have made our two best-performing ConvNet models publicly available to facilitate further research on the use of deep visual representations in computer vision.\n\u003cbr\u003e\n\n**Authors: Karen Simonyan, Andrew Zisserman**\u003cbr\u003e\n**https://arxiv.org/abs/1409.1556**\n\n---\n\n#VGG Architectures\u003cbr\u003e\n![VGG Architecture][1]\n\n\n---\n\n### What is a Pre-trained Model?\nA pre-trained model has been previously trained on a dataset and contains the weights and biases that represent the features of whichever dataset it was trained on. Learned features are often transferable to different data. For example, a model trained on a large dataset of bird images will contain learned features like edges or horizontal lines that you would be transferable your dataset. \n\n### Why use a Pre-trained Model?\nPre-trained models are beneficial to us for many reasons. By using a pre-trained model you are saving time. Someone else has already spent the time and compute resources to learn a lot of features and your model will likely benefit from it. \n\n\n  [1]: https://imgur.com/uLXrKxe.jpg"},{"imageUrl":"https://storage.googleapis.com/kaggle-datasets-images/46538/84648/f1cdf7dddfd83441c6e2add40dbd704c/dataset-thumbnail.jpg?t=2018-08-24-19-54-04","sourceUrl":"/bigquery/patents","slug":"patents","lastUpdated":"2018-09-19T01:57:26.667Z","overview":"Worldwide bibliographic and US patent publications (BigQuery)","sourceType":"dataset","sourceVersionType":"bigQuery","sourceId":103303,"sourceVersionNumber":2,"maxVersionNumber":2,"descriptionMimeType":"text/x-markdown","deleted":false,"private":false,"privateButVisible":false,"ownerInfo":{"databundleVersionId":106753,"dataset":{"datasetId":46538,"datasetVersionId":103303,"dataviewToken":"eyJhbGciOiJkaXIiLCJlbmMiOiJBMTI4Q0JDLUhTMjU2In0..PfCfASa6nlJN9jxRPInrwg.gHJe1yiHnC2Hf_dPC5lA7bL97_X8m8rfFXWKAOYwD_QEuTgscqmNpMo6Th-d5rx-FkWznQ8PkIuUzlSZtOjHKTK8dRaY0qH1-aajgNsrYuSBSVNZjamUs-Uw929sLJguZnje1Lq1YC6shOqbCf85APnvxGQDfYEumHRRvNf1b-X_6SVgZVLpcXqXZrkw2V1y3mQsWlHRBURYDBf9NJZhdcDej-VspwJQnx9jr_1-eEjC0cI30b_Y1onbAgENQyeqcJ-s6XVrLrE8VItITJ6kL50EpDC5OF0lwBz7fagn5AtKytnWlMxnqBpXreCTb3JSG_-E47oWyAveGhAJ4BtrJtntV8gB4OFBG6DWXYyZGST2eNym-TW4aVHXK-roRPFSVp6Ci-LsMU-zcHffVGPB2Uc "44c6f000-bbbd-11e8-b2ba-ac1f6b6435d0_yellow.png","compressedSize":53298,"uncompressedSize":53278,"ownerDatabundleVersionObjectId":null,"type":"archiveEntry","collapsed":true,"info":null,"settings":null,"render":null,"children":[],"name":"44c6f000-bbbd-11e8-b2ba-ac1f6b6435d0_yellow.png","description":null},{"directory":"","fullName":"0be02cc6-bba8-11e8-b2ba-ac1f6b6435d0_yellow.png","compressedSize":114692,"uncompressedSize":114657,"ownerDatabundleVersionObjectId":null,"type":"archiveEntry","collapsed":true,"info":null,"settings":null,"render":null,"children":[],"name":"0be02cc6-bba8-11e8-b2ba-ac1f6b6435d0_yellow.png","description":null}],"name":"train.zip","description":""}],"name":"Human Protein Atlas Image Classification","description":"## What files do I need?\n\nYou will need to download a copy of the images. Due to size, we have provided two versions of the same images. On the data page below, you will find a scaled set of 512x512 PNG files in **train.zip** and **test.zip**. Alternatively, if you wish to work with full size original images (a mix of 2048x2048 and 3072x3072 TIFF files) you may download **train_full_size.7z** and **test_full_size.7z** from [here][1] (warning: these are ~250 GB total).\n\nYou will also need the training labels from **train.csv** and the filenames for the test set from **sample_submission.csv**.\n\n## What should I expect the data format to be?\n\nThe data format is two-fold - first, the labels are provided for each sample in **train.csv**.\n\nThe bulk of the data is in the images - **train.zip** and **test.zip**.  Within each of these is a folder containing **four** files per sample.  Each file represents a different filter on the subcellular protein patterns represented by the sample.  The format should be `[filename]_[filter color].png` for the PNG files, and `[filename]_[filter color].tif` for the TIFF files.\n\n## What am I predicting?\n\nYou are predicting protein organelle localization labels for each sample. There are in total 28 different labels present in the dataset. The dataset is acquired in a highly standardized way using one imaging modality (confocal microscopy). However, the dataset comprises 27 different cell types of highly different morphology, which affect the protein patterns of the different organelles. All image samples are represented by four filters (stored as individual files), the protein of interest (green) plus three cellular landmarks: nucleus (blue), microtubules (red), endoplasmic reticulum (yellow). The green filter should hence be used to predict the label, and the other filters are used as references.\n\nThe labels are represented as integers that map to the following:\n\n    0.  Nucleoplasm  \n    1.  Nuclear membrane   \n    2.  Nucleoli   \n    3.  Nucleoli fibrillar center   \n    4.  Nuclear speckles   \n    5.  Nuclear bodies   \n    6.  Endoplasmic reticulum   \n    7.  Golgi apparatus   \n    8.  Peroxisomes   \n    9.  Endosomes   \n    10.  Lysosomes   \n    11.  Intermediate filaments   \n    12.  Actin filaments   \n    13.  Focal adhesion sites   \n    14.  Microtubules   \n    15.  Microtubule ends   \n    16.  Cytokinetic bridge   \n    17.  Mitotic spindle   \n    18.  Microtubule organizing center   \n    19.  Centrosome   \n    20.  Lipid droplets   \n    21.  Plasma membrane   \n    22.  Cell junctions   \n    23.  Mitochondria   \n    24.  Aggresome   \n    25.  Cytosol   \n    26.  Cytoplasmic bodies   \n    27.  Rods \u0026 rings  \n\n## File descriptions\n\n*   **train.csv** - filenames and labels for the training set.\n*   **sample_submission.csv** - filenames for the test set, and a guide to constructing a working submission.\n*   **train.zip** - All images for the training set.\n*   **test.zip** - All images for the test set.\n\n## Data fields\n\n*   **Id** - the base filename of the sample.  As noted above all samples consist of four files - `blue`, `green`, `red`, and `yellow`.\n*   **Target** - in the training data, this represents the labels assigned to each sample.\n\n\n  [1]: https://console.cloud.google.com/storage/browser/kaggle-human-protein-atlas"},{"imageUrl":"https://storage.googleapis.com/kaggle-competitions/kaggle/3136/logos/thumb76_76.png","sourceUrl":"/c/titanic","slug":"titanic","lastUpdated":"2012-09-28T21:13:33.55Z","overview":"Start here! Predict survival on the Titanic and get familiar with ML basics","sourceType":"competition","sourceVersionType":null,"sourceId":3136,"sourceVersionNumber":null,"maxVersionNumber":null,"descriptionMimeType":"text/html","deleted":false,"private":false,"privateButVisible":false,"ownerInfo":{"databundleVersionId":26502,"dataset":null,"competition":{"competitionId":3136,"dataviewToken":null,"scope":"c/titanic"},"kernel":null,"previewsDisabled":true},"type":"dataSource","collapsed":false,"info":{"metrics":null,"archiveInfo":null,"archiveInfoV2":null,"blobFileInfo":null,"convertCsvInfo":null,"kernelReference":null},"settings":{"csvSettings":null,"bigQuerySettings":null,"bigQueryMirrorSettings":null,"storageSettings":null,"remoteUrlSettings":null,"remoteGithubSettings":null},"render":null,"children":[{"id":63842,"blobFileId":37991,"databundleVersionId":26502,"databundleVersionObjectType":"file","url":null,"relativePath":"../input/gender_submission.csv","creationDate":"2017-02-01T01:49:18Z","isDummy":false,"size":3258,"fullPath":"../input/titanic/gender_submission.csv","previewUrl":"kernels/competition-preview/3136?relativePath=gender_submission.csv","downloadUrl":"/c/titanic/download/gender_submission.csv","fileType":".csv","contentLength":3258,"contentType":"text/csv","contentMD5":"MNEHO5ZKXYFUMexgOg3jUw==","validationErrors":null,"type":"databundleVersionObject","collapsed":false,"info":{"metrics":{"tableMetrics":{"exception":null,"rowCount":418},"columnMetrics":[]},"archiveInfo":null,"archiveInfoV2":null,"blobFileInfo":null,"convertCsvInfo":null,"kernelReference":null},"settings":{"csvSettings":{"delimiter":",","includesHeader":true},"bigQuery est set, we do not provide the ground truth for each passenger. It is your job to predict these outcomes. For each passenger in the test set, use the model you trained to predict whether or not they survived the sinking of the Titanic.\u003c/p\u003e\n\u003cp\u003eWe also include \u003cb\u003egender_submission.csv\u003c/b\u003e, a set of predictions that assume all and only female passengers survive, as an example of what a submission file should look like.\u003c/p\u003e\n\u003ch3\u003eData Dictionary\u003c/h3\u003e\n\u003ctable style=\u0022width: 100%;\u0022\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\u003cth\u003e\u003cb\u003eVariable\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eDefinition\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eKey\u003c/b\u003e\u003c/th\u003e\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esurvival\u003c/td\u003e\n\u003ctd\u003eSurvival\u003c/td\u003e\n\u003ctd\u003e0 = No, 1 = Yes\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003epclass\u003c/td\u003e\n\u003ctd\u003eTicket class\u003c/td\u003e\n\u003ctd\u003e1 = 1st, 2 = 2nd, 3 = 3rd\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esex\u003c/td\u003e\n\u003ctd\u003eSex\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eAge\u003c/td\u003e\n\u003ctd\u003eAge in years\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esibsp\u003c/td\u003e\n\u003ctd\u003e# of siblings / spouses aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eparch\u003c/td\u003e\n\u003ctd\u003e# of parents / children aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eticket\u003c/td\u003e\n\u003ctd\u003eTicket number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003efare\u003c/td\u003e\n\u003ctd\u003ePassenger fare\u003c/td\u003e\n\u0 l":false,"info":null,"name":"volumeCounts3D","description":null},{"order":33,"originalType":"","type":"numeric","extendedType":"integer","isNullable":false,"isPrimaryKey":false,"isLabel":false,"info":null,"name":"volumeCounts5D","description":null},{"order":34,"originalType":"","type":"numeric","extendedType":"integer","isNullable":false,"isPrimaryKey":false,"isLabel":false,"info":null,"name":"volumeCounts7D","description":null}],"totalRows":null,"type":"genericTable","collapsed":true,"info":{"metrics":null,"archiveInfo":null,"archiveInfoV2":null,"blobFileInfo":null,"convertCsvInfo":null,"kernelReference":null},"settings":{"csvSettings":null,"bigQuerySettings":null,"bigQueryMirrorSettings":null,"storageSettings":null,"remoteUrlSettings":null,"remoteGithubSettings":null},"render":null,"children":[],"name":"","description":null}],"name":"news_sample.csv","description":"This is just a sample of the news data. You should not use this data directly.\n\nInstead, call `env.get_training_data()` from the `twosigmanews` package to get the full training sets in your Kernel."}],"name":"Two Sigma: Using News to Predict Stock Movements","description":"In this competition, you will be predicting future stock price returns based on two sources of data:\n\n1. Market data (2007 to present) provided by Intrinio - contains financial market information such as opening price, closing price, trading volume, calculated returns, etc.\n2. News data (2007 to present) Source: Thomson Reuters - contains information about news articles/alerts published about assets, such as article details, sentiment, and other commentary.\n\nEach asset is identified by an `assetCode` (note that a single company may have multiple `assetCode`s). Depending on what you wish to do, you may use the `assetCode`, `assetName`, or `time` as a way to join the market data to news data.\n\nSince this is a Kernels-only, time-based competition, you will not interact directly with the data files as you would in a standard Kaggle competition. You should refer to the [submission instructions](https://www.kaggle.com/c/two-sigma-financial-news/overview/Submission-Instructions) for details on how to fetch data and make predictions. As noted in the instructions, you will encounter synthetic future data within competition data. This is included to simulate the volume, timeline, and the computational burden that real future data will introduce.\n\nThe custom python module also makes it simple to understand what steps are necessary to participate, telling you which assetsCodes to forecast at what time and, by extenstion, which days are market trading days. During stage one, the leaderboard will show performance on a historical period from 2017-01-01 to 2018-07-31. During stage two, Kaggle will re-run participants\u0027 selected Kernels on approximately six months of future data.\n\nThe data is stored and retrieved as Pandas dataframes in the Kernels environment. Columns types are optimized to minimize space in memory.\n\n\n### Market data\n\nThe data includes a subset of US-listed instruments. The set of included instruments changes daily and is determined based on the amount traded and the availability of information. This means that there may be instruments that enter and leave this subset of data. There may therefore be gaps in the data provided, and this does not necessarily imply that that data does not exist (those rows are likely not included due to the selection criteria).\n\nThe marketdata contains a variety of returns calculated over different timespans. All of the returns in this set of marketdata have these properties:\n\n - Returns are always calculated either open-to-open (from the opening time of one trading day to the open of another) or close-to-close (from the closing time of one trading day to the open of another).\n - Returns are either raw, meaning that the data is not adjusted against any benchmark, or market-residualized (Mktres), meaning that the movement of the market as a whole has been accounted for, leaving only movements inherent to the instrument.\n - Returns can be calculated over any arbitrary interval. Provided here are 1 day and 10 day horizons.\n - Returns are tagged with \u0027Prev\u0027 if they are backwards looking in time, or \u0027Next\u0027 if forwards looking.\n\nWithin the marketdata, you will find the following columns:\n\n - `time`(datetime64[ns, UTC]) - the current time (in marketdata, all rows are taken at 22:00 UTC)\n - `assetCode`(object) - a unique id of an asset\n - `assetName`(category) - the name that corresponds to a group of `assetCodes`. These may be \u0022Unknown\u0022 if the corresponding `assetCode` does not have any rows in the news data.\n - `universe`(float64) - a boolean indicating whether or not the instrument on that day will be included in scoring. This value is not provided outside of the training data time period. The trading universe on a given date is the set of instruments that are avilable for trading (the scoring function will not consider instruments that are not in the trading universe). The trading universe changes daily.\n - `volume`(float64) - trading volume in shares for the day\n - `close`(float64) - the close price for the day (not adjusted for splits or dividends)\n - `open`(float64) - the open price for the day (not adjusted for splits or dividends)\n - `returnsClosePrevRaw1`(float64) - see returns explanation above\n - `returnsOpenPrevRaw1`(float64) - see returns explanation above\n - `returnsClosePrevMktres1`(float64) - see returns explanation above\n - `returnsOpenPrevMktres1`(float64) - see returns explanation above\n - `returnsClosePrevRaw10`(float64) - see returns explanation above\n - `returnsOpenPrevRaw10`(float64) - see returns explanation above\n - `returnsClosePrevMktres10`(float64) - see returns explanation above\n - `returnsOpenPrevMktres10`(float64) - see returns explanation above\n - **`returnsOpenNextMktres10`(float64) - 10 day, market-residualized return. This is the target variable used in competition scoring. The market data has been filtered such that `returnsOpenNextMktres10` is always not null.**\n\n### News data\n\nThe news data contains information at both the news article level and asset level (in other words, the table is intentionally not normalized).\n\n - `time`(datetime64[ns, UTC]) - UTC timestamp showing when the data was available on the feed (second precision)\n - `sourceTimestamp`(datetime64[ns, UTC]) - UTC timestamp of this news item when it was created \n - `firstCreated`(datetime64[ns, UTC]) - UTC timestamp for the first version of the item\n - `sourceId`(object) - an Id for each news item\n - `headline`(object) - the item\u0027s headline\n - `urgency`(int8) - differentiates story types (1: alert, 3: article)\n - `takeSequence`(int16) - the take sequence number of the news item, starting at 1. For a given story, alerts and articles have separate sequences.\n - `provider`(category) - identifier for the organization which provided the news item (e.g. RTRS for Reuters News, BSW for Business Wire)\n - `subjects`(category) - topic codes and company identifiers that relate to this news item. Topic codes describe the news item\u0027s subject matter. These can cover asset classes, geographies, events, industries/sectors, and other types.\n - `audiences`(category) - identifies which desktop news product(s) the news item belongs to. They are typically tailored to specific audiences. (e.g. \u0022M\u0022 for Money International News Service and \u0022FB\u0022 for French General News Service)\n - `bodySize`(int32) - the size of the current version of the story body in characters\n - `companyCount`(int8) - the number of companies explicitly listed in the news item in the subjects field\n - `headlineTag`(object) - the Thomson Reuters headline tag for the news item\n - `marketCommentary`(bool) - boolean indicator that the item is discussing general market conditions, such as \u0022After the Bell\u0022 summaries\n - `sentenceCount`(int16) - the total number of sentences in the news item. Can be used in conjunction with firstMentionSentence to determine the relative position of the first mention in the item.\n - `wordCount`(int32) - the total number of lexical tokens (words and punctuation) in the news item\n - `assetCodes`(category) - list of assets mentioned in the item\n - `assetName`(category) - name of the asset\n - `firstMentionSentence`(int16) - the first sentence, starting with the headline, in which the scored asset is mentioned.\n    - 1: headline\n    - 2: first sentence of the story body\n    - 3: second sentence of the body, etc\n    - 0: the asset being scored was not found in the news item\u0027s headline or body text. As a result, the entire news item\u0027s text (headline + body) will be used to determine the sentiment score.\n - `relevance`(float32) - a decimal number indicating the relevance of the news item to the asset. It ranges from 0 to 1. If the asset is mentioned in the headline, the relevance is set to 1. When the item is an alert (urgency == 1), relevance should be gauged by firstMentionSentence instead.\n - `sentimentClass`(int8) -  indicates the predominant sentiment class for this news item with respect to the asset. The indicated class is the one with the highest probability.\n - `sentimentNegative`(float32) - probability that the sentiment of the news item was negative for the asset\n - `sentimentNeutral`(float32) - probability that the sentiment of the news item was neutral for the asset\n - `sentimentPositive`(float32) - probability that the sentiment of the news item was positive for the asset\n - `sentimentWordCount`(int32) - the number of lexical tokens in the sections of the item text that are deemed relevant to the asset. This can be used in conjunction with wordCount to determine the proportion of the news item discussing the asset.\n - `noveltyCount12H`(int16) - The 12 hour novelty of the content within a news item on a particular asset. It is calculated by comparing it with the asset-specific text over a cache of previous news items that contain the asset.\n - `noveltyCount24H`(int16) - same as above, but for 24 hours\n - `noveltyCount3D`(int16) - same as above, but for 3 days\n - `noveltyCount5D`(int16) - same as above, but for 5 days\n - `noveltyCount7D`(int16) - same as above, but for 7 days\n - `volumeCounts12H`(int16) - the 12 hour volume of news for each asset. A cache of previous news items is maintained and the number of news items that mention the asset within each of five historical periods is calculated.\n - `volumeCounts24H`(int16) - same as above, but for 24 hours\n - `volumeCounts3D`(int16) - same as above, but for 3 days\n - `volumeCounts5D`(int16) - same as above, but for 5 days\n - `volumeCounts7D`(int16) - same as above, but for 7 days\n\n\nMarket data provided by Intrinio.\n\n![Intrinio](https://storage.googleapis.com/kaggle-media/competitions/two-sigma/Intrinio-Logo-1100smpx.png)\n\nNews data provided by Thomson Reuters. Copyright \u0026copy;, Thomson Reuters, 2017. All Rights Reserved. Use, duplication, or sale of this service, or data contained herein, except as described in the [Competition Rules](https://www.kaggle.com/c/two-sigma-financial-news/rules), is strictly prohibited. The THOMSON REUTERS Kinesis Logo and THOMSON REUTERS are trademarks of Thomson Reuters and its affiliated companies in the United States and other countries and used herein under license.\n\n![Thomson Reuters](https://storage.googleapis.com/kaggle-media/competitions/two-sigma/thomson_reuters.png)\n"}],"versions":[{"id":6658422,"kernelVersionId":null,"isForkParent":false,"isNotebook":true,"languageName":"R","lastRunTime":"2018-10-20T22:22:40.88Z","linesChangedFromPrevious":0,"linesDeletedFromPrevious":0,"linesInsertedFromPrevious":0,"outputFilesTotalSizeBytes":0,"runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/
